import {Link} from "react-router-dom";

const NavBar = () => {
    return (
      <div className='nav'>
        <Link 
        className='homeBtn'
        to="/">Home</Link>
        <Link
        className='profileBtn' 
        to="/profile">Profile</Link>
      </div>
    );
  };

  export default NavBar;
